import React, { useState } from 'react'
import  ReactDOM  from 'react-dom'
import './index.css'
let root=ReactDOM.createRoot(document.getElementById('root'));
let mat=[];
let current;
for(let i=0;i<5;i++){
  let t=[];
  for(let j=0;j<5;j++)
  t.push(' ');
  mat.push(t);
}
let r;
class Page extends React.Component{
  componentDidMount(){
    r=document.getElementById('root');

  }
  render(){
    return(
      <><Learn/><Grid/><Instruction/><Logicpanel/><Controls/><Play text="play"/><Play text="reset"/></>
    )
  }
}
function Grid(){
  return(
    <div className='Grid'>
    {mat.map((arr,index)=><Row arr={arr} row={index}/>)}
    </div>
  )
}
function Row(props){
return(
  <div className='Row'>
    {props.arr.map((element,index)=><Element val={element} row={props.row} col={index}/>)}
  </div>
)
}
class Element extends React.Component{
  constructor(props)
  {
    super(props)
    this.state={val:this.props.val}
  }
  render(){
    return(
      <div className='Element' draggable onDrag={()=>current=this.state.val}> 
        {this.state.val}
      </div>
    )
  }
}
function Instruction(){
  return (
    <div className='instruction'>
      <li>instruction</li>
    </div>
  )
}
function Learn(){
return(
  <div className='learn'>

  </div>
)
}
function Panelbutton(){
  const [val,setVal]=useState('');
  return(
    <input draggable onDragOver={(e)=>{e.preventDefault();setVal(current)}} className='panelbutton' value={val}/>
  )
}
function Logicpanel(){
  const items=[];
  for(let i=0;i<15;i++)
  items.push(<Panelbutton/>)
  return(
    <div className='logicpanel' >
      <li>Logicpanel</li>
      {items.map((ele)=>{return ele})}

    </div>
  )
}
function Controls(){
  return(
    <div className='controls'>
              <Element val="up"/><Element val="down"/><Element val="left"/><Element val="right"/>

    </div>
  )
}
function Play(props){

  return(
    <div className='play'>
      {props.text}
    </div>
  )
}
root.render(<Page/>);
